__NUXT_JSONP__("/drugs/Atiprimod_Dihydrochloride", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"130065-61-1",chebiId:"",chemicalFormula:"C22H44N2.2ClH",definition:"The dihydrochloride salt form of atiprimod, an orally bioavailable small molecule belonging to the azaspirane class of cationic amphiphilic agents with anti-inflammatory, antineoplastic, and anti-angiogenic activities. Atiprimod inhibits the phosphorylation of signal transducer and activator of transcription 3 (STAT3) and AKT, blocking the signaling pathways of interleukin-6, vascular endothelial growth factor (VEGF) and downregulating the anti-apoptotic proteins Bcl-2, Bcl-XL, and Mcl-1. This results in the inhibition of cell proliferation, induction of cell cycle arrest, and apoptosis.",fdaUniiCode:"O12I24570R",identifier:"C76969",preferredName:b,semanticType:"Pharmacologic Substance",subclassOf:["C1742","C2189"],synonyms:["ATIPRIMOD DIHYDROCHLORIDE",b]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAtiprimod_Dihydrochloride",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Atiprimod_Dihydrochloride","Atiprimod Dihydrochloride","2021-10-30T13:44:42.363Z")));